import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-car-compare',
  templateUrl: './car-compare.page.html',
  styleUrls: ['./car-compare.page.scss'],
})
export class CarComparePage implements OnInit {

  constructor() { }

  ngOnInit() {
  }

}
<ion-header>
  <ion-toolbar>
    <ion-title>car-compare</ion-title>
  </ion-toolbar>
</ion-header>

<ion-content>
  <ion-list>
    <ion-item *ngFor="let c of cars">
      <h2>{{ c.Marca }} {{ c.Modelo }}  {{ c.Precio }} {{ c.Descripcion }}</h2>
    </ion-item>
  </ion-list>
</ion-content>
